    public function index()
    {
        $this->logSys(session('emp_atpid'),"访问日志","访问页面：【系统管理】 / 【数据库管理】");
        $this->display();
    }


    public function add()
    {
        $this->display();
        $this->logSys(session('emp_atpid'),"访问日志","访问页面：【系统管理】 / 【数据库管理】 / 【添加】");
    }

    public function edit(){
        $id = $_GET['id'];
        if ($id) {
            $Model = M('plc');
            $data = $Model->where("db_atpid='%s'", array($id))->find();
            if ($data) {
                $this->assign('data', $data);
            }
        }
        $this->display("add");
        $this->logSys(session('emp_atpid'),"访问日志","访问页面：【系统管理】 / 【数据库管理】 / 【编辑】");
    }



    public function del()
    {
        try {
            $ids = $_POST['ids'];
            $array = explode(',', $ids);
            if ($array && count($array) > 0) {
                $Model = M("database");
                foreach ($array as $id) {
                    $data = $Model->where("db_atpid='%s'", array($id))->find();
                    $data['db_atpstatus'] = 'DEL';
                    $data['db_atplastmodifydatetime'] = date('Y-m-d H:i:s', time());
                    $data['db_atplastmodifyuser'] = session('emp_account');
                    $data['db_atpsort'] = time();
                    $Model->where("db_atpid='%s'", $id)->save($data);
                }
            }
        } catch (\Exception $e) {
            echo "fail" . $e;
        }
        $this->logSys(session('emp_atpid'),"访问日志","访问页面：【系统管理】 / 【数据库管理】 / 【删除】");
    }

    public function submit(){
        $Model = M('database');
        $data = $Model->create();
        if (null == $data['db_atpid']) {
            //添加
            $data['db_atpid'] = $this->makeGuid();
            $data['db_atpcreatedatetime'] = date('Y-m-d H:i:s', time());
            $data['db_atpcreateuser'] = session('emp_account');
            $data['db_atplastmodifydatetime'] = date('Y-m-d H:i:s', time());
            $data['db_atplastmodifyuser'] = session('emp_account');
            $Model->add($data);

        } else {
            //修改
            $data['db_atplastmodifydatetime'] = date('Y-m-d H:i:s', time());
            $data['db_atplastmodifyuser'] = session('emp_account');
            $Model->where("db_atpid='%s'", array($data['db_atpid']))->save($data);
        }
    }


    public function getData(){
        $queryparam = json_decode(file_get_contents("php://input"), true);
        $Model = M();
        $sql_select = "
				select
					*
				from szny_database t ";
        $sql_count = "
				select
					count(1) c
				from szny_database t ";
        $sql_select = $this->buildSql($sql_select, "t.db_atpstatus is null");
        $sql_count = $this->buildSql($sql_count, "t.db_atpstatus is null");

        //快捷搜索
        if (null != $queryparam['search']) {
            $searchcontent = trim($queryparam['search']);
            $sql_select = $this->buildSql($sql_select, "t.db_name like '%" . $searchcontent . "%'");
            $sql_count = $this->buildSql($sql_count, "t.db_name like '%" . $searchcontent . "%'");
        }
        if (null != $queryparam['db_dt']) {
            $searchcontent = trim($queryparam['db_dt']);
            $sql_select = $this->buildSql($sql_select, "t.db_dt like '%" . $searchcontent . "%'");
            $sql_count = $this->buildSql($sql_count, "t.db_dt like '%" . $searchcontent . "%'");
        }
        // dump($sql_select);

        //排序
        if (null != $queryparam['sort']) {
            $sql_select = $sql_select . " order by " . $queryparam['sort'] . ' ' . $queryparam['sortOrder'] . ' ';
        } else {
            $sql_select = $sql_select . " order by t.db_name desc ";
        }

        //自定义分页
        if (null != $queryparam['limit']) {

            if ('0' == $queryparam['offset']) {
                $sql_select = $sql_select . " limit " . '0' . ',' . $queryparam['limit'] . ' ';
            } else {
                $sql_select = $sql_select . " limit " . $queryparam['offset'] . ',' . $queryparam['limit'] . ' ';
            }
        }
        $Result = $Model->query($sql_select);
        $Count = $Model->query($sql_count);
        echo json_encode(array('total' => $Count[0]['c'], 'rows' => $Result));
    }


